import React,{useState} from 'react';
import axios from 'axios';
function Login(){
const [email,setEmail]=useState(''); const [password,setPassword]=useState('');
const handleSubmit=async(e)=>{e.preventDefault(); try{ const res=await axios.post('http://localhost:5000/auth/login',{email,password}); console.log(res.data);}catch(err){console.log(err);}};
return <form onSubmit={handleSubmit} className="max-w-md mx-auto mt-10">
<input className="border p-2 w-full mb-2" placeholder="Email" value={email} onChange={e=>setEmail(e.target.value)}/>
<input type="password" className="border p-2 w-full mb-2" placeholder="Password" value={password} onChange={e=>setPassword(e.target.value)}/>
<button type="submit" className="bg-blue-600 text-white px-4 py-2">Login</button>
</form>;
}
export default Login;
